function Korok(hash, offset, value, location){
	this.hash=hash;
	this.offset=offset;
	this.value=value;
	this.location=location;
}

Korok.readAll=function(){
	var koroks=[];
	var korokOffsets=SavegameEditor._getOffsetsByHashes(Korok.HASHES);
	for(var i=0; i<Korok.HASHES.length; i++){
		koroks.push(new Korok(
			Korok.HASHES[i],
			korokOffsets[Korok.HASHES[i]],
			tempFile.readU32(korokOffsets[Korok.HASHES[i]]),
			null
		));
	}
	return koroks;
}
Korok.count=function(koroks){
	var count=0;
	for(var i=0; i<koroks.length; i++){
		count+=koroks[i].value;
		if(koroks[i].value>1)
			console.warn('invalid korok count '+koroks[i].hash.toString(16)+': '+koroks[i].value);
	}
	return count;
}


